import XMLData from "./carsData/Cars.xml"

import { useState, useEffect } from "react";


import axios from "axios";

function Xml() {
    axios.get(XMLData, {
        "Content-Type": "application/xml; charset=utf-8"
    })
        .then((response) => {
            console.log('ini data xml', response.data);

        });
}

export default Xml;
